@Michael R. Gorman The Romans assimilated cultures and practices as they expanded. Why did the romans keep the roman numeral system and alphabet instead of using the hundred times more innovative Celtic writing and number systems? Was the Celtic system the same across the whole region/empire, was it a unified language and culture? Were the Native Americans a unified culture across the whole continent? Were the African tribes unified across their continent? Did all peoples practice better agriculture than the Greco-Roman Eurocentric culture? If so, why did they abandon their practices for inferior practices and why didn't the Europeans adopt their cultures?

The African and American continents did not have domesticated animals until contact with Europeans. It is picturesque to view the Native Americans riding horses, but they had no access to them before the arrival of Europeans.  They did use dogs as pack animals for their nomadic journeys, but you portray all of the varied tribes as being the same, farmers.

Just a hundred years ago, 80% of people in the US lived in a rural setting, they all had gardens with a variety of produce. Today 80% of the population live in big cities with no access to a garden. The industrial nature of today's farms is what allows people to live in big cities, far from where food is grown. It would be more sustainable for people to live where the food is grown and for everyone to grow their own food. A small farm produces enough food for 700 people and one combine replaces the labor of 700 people. Instead of transporting food from the farms to the cities, we should have everyone living on farms. The added advantage of everyone living on farms would be that no one would have time to worry about climate change, just the weather.

